import Link from 'next/link';
import {
  NavLink,
  Flex
} from 'theme-ui'

const Header = () => (
  <Flex as='nav'>
    <Link href="/">
      <NavLink href='#!' p={2}>
        Home
      </NavLink>
    </Link>

    <NavLink href='#!' p={2}>
      Blog
    </NavLink>
    <NavLink href='#!' p={2}>
      About
    </NavLink>
  </Flex>
);

export default Header;
